/*Table structure for table `user_credentials` */

DROP TABLE IF EXISTS `user_credentials`;

CREATE TABLE `user_credentials` (
  `id` int(32) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `userId` bigint(64) DEFAULT NULL COMMENT '用户id',
  `platform` int(32) DEFAULT NULL COMMENT '登录平台',
  `unionId` varchar(50) DEFAULT NULL COMMENT '第三方平台用户标识',
  `createTime` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `lastLoginTime` timestamp NULL DEFAULT NULL COMMENT '上次登录时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='第三方登录表';

